import * as types from "./actionType";

const initalState = {
    isLoading: false,
    isError: false,
    isAuth: false,
}

const reducer = (state = initalState, action) => {
    const { type, payload } = action;
    switch (type) {
        
        default:
            return state;
    }
}

export { reducer }
